    {

		/* Helper Functions */
		
		function getResourceFolder () {
			var userFolder = Folder.userData;
			var resourceFolderPath = userFolder.toString() + "/Yan-K_Resource/Switch";
			var resourceFolder = new Folder(resourceFolderPath);
			if (!resourceFolder.exists) {
				var createFolder = resourceFolder.create();
				if (!createFolder) {
					alert ("Create Resource Folder Error!");
					return null;
				}
			}
			return resourceFolder.toString();
		}

		function createResourceFile (file, binary, folder) {
			var resourceFile = new File(folder+"/"+file);
			if (!(checkWriteAccess())) 
			{
				alert ("Script require write access, go to preferences and make sure Allow Scripts to Write Files and Access Network is checked.");
				app.executeCommand(2359);
				return null;
			}
			resourceFile.encoding = "BINARY";
			resourceFile.open("w");
			resourceFile.write(binary);
			resourceFile.close();
			return resourceFile;
		}
		
		function checkWriteAccess(){
			var accessSetting;
			try{
				accessSetting = app.preferences.getPrefAsLong("Main Pref Section","Pref_SCRIPTING_FILE_NETWORK_SECURITY");
			}catch(err){
				return (accessSetting == 1);
			}
			return (accessSetting == 1);
		}
		
		/* Switch System */
		function applySwitch(){
			
			app.beginUndoGroup("Apply Yan-K Switch");

            var selectComp = app.project.activeItem;
            var selectLayers = selectComp.selectedLayers;
           
            myLayers = [];
  
  
            for (var l = 0; l< selectLayers.length; l++){  
                myLayers.push(selectLayers[l].index);
            }  
            
            var precompIndices = myLayers;
            var precompName = "SwitchComp"+"_"+selectLayers[0].name; 
            var precomp = selectComp.layers.precompose(precompIndices, precompName, true);       
            var newCompDuration = selectLayers.length; 

            precomp.duration = newCompDuration;  
            
            for (i=1 ; i<precomp.numLayers+1 ; i++){
                precomp.layer(i).inPoint = i-1;
                precomp.layer(i).outPoint = i;
            }
            
            var sliderExp = 'effect("Yan-K Switch Control")("Slider")%' + newCompDuration.toString();

            for (i=1 ; i<=selectComp.numLayers ; i++){
                if (selectComp.layer(i).name == precompName){
                    newSlider = selectComp.layer(i).property("Effects").addProperty("Slider Control");
                    newSlider.name = "Yan-K Switch Control"
                    selectComp.layer(i).timeRemapEnabled = 1;
                    selectComp.layer(i).property("Time Remap").expression = sliderExp;
                }
            }

            

			app.endUndoGroup();
		}
    }
